import React from 'react';


class Summary extends React.Component {
	render() {
		const {summary, currentDate} = this.props;
		return (
			<div className="row">
            <div className="NewConfirmed">
            <h1>New Confirmed</h1>
            <h1>{summary.NewConfirmed}</h1>
            </div>
			</div>
		);
	}
}

export default Summary;
